import React from "react";

class Header extends React.Component {
  render() {
    return (
      <div>
        <header id="header">
          <nav>
            <ul className="navbar">
              <li>Water</li>
              <li>Ingredients</li>
              <li>Dishes</li>
              <li>Meals</li>
            </ul>
          </nav>
        </header>
      </div>
    );
  }
}

export default Header;
